const SiparisOnayi = () => {
  return (
    <div>
      <h2>Siparişiniz başarıyla alındı!</h2>
      <p>En kısa sürede sizinle iletişime geçeceğiz.</p>
    </div>
  );
};

export default SiparisOnayi;
